import React, { useState, useEffect } from "react";
import { getAllNames } from "./LearnService";
import MainList from "./MainList";

const Main = () => {
  const [names, setNames] = useState([]);

  // UseEffect to fetch data when the component loads
  useEffect(() => {
    getAllNames().then((fetchedNames) => {
      setNames(fetchedNames);
    });
  }, []);

  return (
    <div>
      This is the main stateful parent component.
      <MainList names={names} />
    </div>
  );
};

export default Main;
